import React from 'react';
import {Autocomplete} from '@react-google-maps/api';
import { AppBar, Toolbar, Typography, InputBase, Box } from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import { styled } from '@mui/system'; // Import styled from @mui/system

const HeaderContainer = styled(AppBar)({
  position: 'static',
});

const ToolbarContainer = styled(Toolbar)({
  display: 'flex',
  justifyContent: 'space-between',
});

const TitleTypography = styled(Typography)({
  display: 'none',
  '@media (min-width:600px)': {
    display: 'block',
  },
});

const ExploreTypography = styled(Typography)({
  display: 'none',
  '@media (min-width:600px)': {
    display: 'block',
  },
});

const SearchContainer = styled('div')({
  position: 'relative',
  borderRadius: '4px',
  backgroundColor: '#fff',
  '&:hover': {
    backgroundColor: '#fff',
  },
  marginRight: '8px',
  marginLeft: 0,
  width: '100%',
  '@media (min-width:600px)': {
    marginLeft: '12px',
    width: 'auto',
  },
});

const SearchIconContainer = styled('div')({
  padding: '8px',
  height: '100%',
  position: 'absolute',
  pointerEvents: 'none',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
});

const InputBaseContainer = styled(InputBase)({
  root: {
    color: 'inherit',
  },
  input: {
    padding: '8px',
    paddingLeft: 'calc(1em + 32px)',
    transition: 'width 300ms cubic-bezier(0.4, 0, 0.2, 1) 0ms',
    width: '100%',
    '@media (min-width:600px)': {
      width: '20ch',
    },
  },
});

const Header = () => {
  return (
    <HeaderContainer>
      <ToolbarContainer>
        <TitleTypography variant="h5">Travel Advisor</TitleTypography>
        <Box display="flex">
          <ExploreTypography variant="h6">Explore New Places</ExploreTypography>
          <SearchContainer>
            <SearchIconContainer>
              <SearchIcon />
            </SearchIconContainer>
            <InputBaseContainer placeholder="Search..." />
          </SearchContainer>
        </Box>
      </ToolbarContainer>
    </HeaderContainer>
  );
};

export default Header;
